export const TypeList = ({typeList}) => {
  return (
    <div>
      {
        typeList.map(type => {
          const {label, src, alt} = type
          return (
            <>
              <img
                src={src}
                alt={alt}
              />
              {label}
            </>
            )
        })
      }
    </div>
  )
}
